const Cart = () => {

  const {cart} = useSelector((state) => state.cart);

  return 
    <div>
      {
        cart.length > 0 ?
        (<div></div>) :
        (<div>
          <h1>Cart Empty</h1>
          </div>)
      }
    </div>;

};

export default Cart;
